function getProductIcon(productName) {
    if (productName.includes("display")) return PRODUCTS.display
    else if (productName.includes("pre roll")) return PRODUCTS["pre roll"]
    else if (productName.includes("ott")) return PRODUCTS.ott
    else if (productName.includes("ctv") || productName.includes("connected tv")) return PRODUCTS.ctv
    else if (productName.includes("geofence") || productName.includes("geovideo")) return PRODUCTS.geofence
    else if (productName.includes("streaming audio")) return PRODUCTS.generic
    else if (productName.includes("sem")) return PRODUCTS.sem
    else if (productName.includes("social")) return PRODUCTS.social
    else if (productName.includes("raio")) return PRODUCTS.radio
    else if (productName.includes("television")) return PRODUCTS.ctv
    else return PRODUCTS.generic
}

